import Link from 'next/link';

const linkStyle = {
  marginRight: 20
};
const logoStyle = {
  marginLeft: 17,
  marginRight: 1000,
  width: '10%'
};
const Header = () => (
  <div>

    <Link href="/">
      <a style={linkStyle}> <img style={logoStyle} src="../static/logo.png"/></a>
    </Link>
    <Link href="/amazon">
      <a style={linkStyle}>Amazon</a>
    </Link>
  </div>

);

export default Header;
